import React from 'react';
import style from "./Header.module.css"

const Header = () => {
    return(
        <div className={style.header}>
            <img src='https://yandex.ru/images/search?text=%D0%B8%D0%BA%D0%BE%D0%BD%D0%BA%D0%B0%20%D0%B3%D0%B8%D1%82%D0%B0%D1%80%D1%8B&iorient=horizontal&itype=png&from=tabbar&p=11&pos=644&rpt=simage&img_url=https%3A%2F%2Fguitar-science.ru%2Fimages%2Fgitari%2Fgibson_standard_sg1.jpg'></img>
        </div>
    )
};

export default Header;
